import React from 'react';
import Time from './time';

const AppMain = () => {
    return ( 
        <div className="appMain">
            <h1 className="mainHeader">Software Developer</h1>
            <div className="clockContainer">
                <div className="city">
                    Tokyo
                    <Time timeZone="Japan"/>
                </div>
                <div className="city">
                    <div>LosAngeles</div>
                    <Time timeZone={"LA"}/>
                </div>
            </div>
        </div>
     );
}
 
export default AppMain;
